INSERT INTO `aggregator_item` VALUES (2,1,'Fido, Take the Wheel','http://knowyourmeme.com/videos/127817-dogs','','<img alt=\"D70olsu\" src=\"http://i.imgur.com/D70Olsu.jpg?fb\" /><p>When little Timmy had too much to drink, the family dog was forced into the role of designated driver.</p>',1444860534,'post:18816'),(3,1,'One Punch Man Anime Premieres in Japan','http://knowyourmeme.com/memes/subcultures/one-punch-man','','<img alt=\"49b\" src=\"http://i2.kym-cdn.com/news_feeds/icons/mobile/000/018/819/49b.jpg\" /><p>The first two episodes of the much anticipated anime adaptation of <i>One Punch Man</i> were finally aired in Japan this month.</p>',1444863415,'post:18819'),(4,1,'’Tis the Season to Be Forever Alone','http://knowyourmeme.com/photos/1029494-forever-alone','','<img alt=\"336\" src=\"http://i2.kym-cdn.com/photos/images/newsfeed/001/029/494/336.jpg\" />',1444864413,'post:18821'),(5,1,'Legend of Zelda: Symphony of The Goddesses','http://knowyourmeme.com/videos/128124-the-legend-of-zelda','','<img alt=\"1a9\" src=\"http://i3.kym-cdn.com/news_feeds/icons/mobile/000/018/824/1a9.jpg\" /><p>Rejoice, nerds! This is the music that awaits you in heaven. Check out The Legend of Zelda: Symphony of the Goddesses’ performance on the Late Show with Stephen Colbert.</p>',1444934645,'post:18824'),(6,1,'“Your Mom” Jokes','http://knowyourmeme.com/memes/your-mom-jokes','','<img alt=\"3bc\" src=\"http://i3.kym-cdn.com/news_feeds/icons/mobile/000/018/823/3bc.jpg\" /><p>The earliest recorded example of a maternal insult joke comes from an ancient Babylonian tablet dated back to 1,500 <span class=\"caps\">BCE</span>, which contains an incomplete riddle about a promiscuous mother.</p>',1444928716,'post:18823'),(7,1,'DBZ Voice Actors Dub Over Classic Movies','http://knowyourmeme.com/videos/128169-dragon-ball','','<img alt=\"D8c\" src=\"http://i1.kym-cdn.com/news_feeds/icons/mobile/000/018/826/d8c.jpg\" /><p>Some of the most recognizable voices behind the characters of Dragon Ball Z gather at The Nerdist studio for a parody dub of famous film scenes from <em>Ace Ventura</em> and <em>Independence Day</em> to <em>Zoolander</em> and <em>Meet the Parents</em>.</p>',1444939569,'post:18826'),(8,1,'Happy Birthday, Cure-chan!','http://knowyourmeme.com/memes/cure-chan','','<img alt=\"E8c\" src=\"http://i3.kym-cdn.com/news_feeds/icons/mobile/000/018/825/e8c.jpg\" /><p>The archnemesis of <a href=\"/memes/ebola-chan\">Ebola-chan</a> was born one year ago this week.</p>',1444938083,'post:18825'),(9,1,'That Face When Retweets Ain’t Coming In','http://knowyourmeme.com/photos/1029430-my-face-when','','<img alt=\"C51\" src=\"http://i2.kym-cdn.com/news_feeds/icons/original/000/018/827/c51.jpg\" />',1444940736,'post:18827'),(10,1,'Back to the Future Stars Talk Film’s Predictions','http://knowyourmeme.com/videos/128173-back-to-the-future-day','','<img alt=\"944\" src=\"http://i2.kym-cdn.com/news_feeds/icons/mobile/000/018/828/944.jpg\" /><p>In honor of next week being the real <a href=\"/memes/back-to-the-future-day\">Back to the Future Day</a>, Christopher Lloyd and Michael J. Fox recently got together (at the prompting of Toyota) to discuss which of the film’s predictions have come to pass in 2015.</p>',1444943309,'post:18828'),(11,1,'Chad Says Beta Things','http://knowyourmeme.com/memes/chad-says-beta-things','','<img alt=\"937\" src=\"http://i1.kym-cdn.com/news_feeds/icons/mobile/000/018/829/937.jpg\" /><p>This series of awkward Tinder messages sent by a fake <a href=\"http://knowyourmeme.com/memes/chad-thundercock\">Chad</a> Tinder profile has caused a recent surge in popularity of the corn emoji.</p>',1444944831,'post:18829');
